        rc = wtpIfSpeed_set(rowreq_ctx, *((u_long *)var->val.string) );
        break;

    /* wtpIfAdminStatus(8)/INTEGER/ASN_INTEGER/long(u_long)//l/A/W/E/r/d/h */
    case COLUMN_WTPIFADMINSTATUS:
        if(var->val_len != sizeof(u_long)) {
            rc = SNMP_ERR_WRONGLENGTH;
            snmp_log(LOG_ERR,
                     "varbind size of %d does not match expected size %d\n",
                     var->val_len, sizeof(u_long));
            break;
        }
        rowreq_ctx->column_set_flags |= FLAG_WTPIFADMINSTATUS;
        rc = wtpIfAdminStatus_set(rowreq_ctx, *((u_long *)var->val.string) );
        break;

     default:
         snmp_log(LOG_ERR,"unknown column %d in _dot11WtpIfTable_set_column\n", column);
         break;
